class Home extends Component {
  constructor(props){
    super(props);

    this.state = {
      flipCard: "flip-card",
      flipCardInner: "flip-card-inner"
    }

    this.rotate = this.rotate.bind(this);
    this.rotateBack = this.rotateBack.bind(this);
  }

 rotate(){
  console.log('hej');
    this.setState({
        flipCard: "flip-card-rotate",
      flipCardInner: "flip-card-inner-rotate"
    })   
  }

  rotateBack(){
    console.log('hejdå');
     this.setState({
      flipCard: "flip-card",
      flipCardInner: "flip-card-inner"
    })  
  }

  render() {
    return (
      <div className="wrapper wrapper-startpage">
      <Header />

      <div className="box">
       <button onClick={this.rotate}>flippa</button>
        <div className={this.state.flipCard} onClick={this.rotateBack}>
        <div className={this.state.flipCardInner}>
        <div class="flip-card-front">
      <i class="fas fa-heart fa-5x"></i>
    </div>

          <div className="flip-card-back">
            <h1>John Doe</h1> 
            <p>Architect & Engineer</p> 
            <p>We love that guy</p>
          </div>
        </div>
      </div>
    </div>

   <Carousel />    
 </div>
    )
  }
}

export default Home;
